import React from "react";
import styled from 'styled-components'

const Wrapper = styled.div`
    width: 100%;
    height: 64px;
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: #c000d9;
    color: #fff;
    font-size: 20px;
    font-weight: 300;
    font-family: MuseoSansCyrl;
    a {
      color: #fff;
      text-decoration: underline;
      cursor: pointer;
      font-weight: 300;
      margin-left: 35px;
      font-size: 20px;
    }
`

export const Header = () => {
    return <Wrapper>Сомневаетесь? Протестируйте до 30 дней бесплатно! <a>
        Попробовать </a>
    </Wrapper>
}
